INSERT INTO `obavestenje` VALUES (1, 'Oktobarski ispitni rok biće održan od 23. do 28. oktobra 2023. godine. Prijava ispita počinje 13. oktobra 2023. godine.\n\nU oktobarskom ispitnom roku, ispite mogu prijavljivati studenti koji su definisali svoj status studiranja, odnosno upisali akademsku 2023/2024. godinu.\n\nStudenti koji nastavu prate po sistemu blokovske nastave u oktobarskom ispitnom roku mogu da prijave predmet koji su slušali u prvom bloku školske 2023/24 godine.\n\nSvi studenti sa aktivnim statusom u 2023/24 godini  mogu da prijave predmete koje su odslušali u prethodnoj školskoj godini.\n\nRasporedi ispita biće naknadno objavljeni u sekciji Studenti -> Rasporedi -> Raspored ispitnih rokova.\n\nUplata za prijavu ispita treba da se izvrši najkasnije 10 dana pre održavanja ispita.\n\nRok za prijavu ispita po redovnoj ceni od 500 dinara je 5 dana pre održavanja ispita do 14h (ne računajući dan održavanja ispita). Prijava ispita vrši se preko portala estudent.singidunum.ac.rs.\n\nNakon isteka roka za redovnu prijavu ispita ispit se može prijaviti po ceni naknadne prijave od 3.000 dinara za 1 ispit, najkasnije 1 dan pre održavanja ispita do 14.00. Naknadna prijava se realizuje isključivo slanjem mejla sa singimejl adrese na estudent@singidunum.ac.rs. Ispit se ne može prijaviti na dan održavanja ispita.\n\nUputstvo za prijavu ispita nalazi se na sledećem linku\n\nUslov za prijavu ispita je izmirena školarina za školsku 2023/24. godinu prema Ugovoru o studiranju tj. definisanoj dinamici otplate.', '2023-10-21', '2023-10-31', 'Redovan oktobarski ispitni rok');
INSERT INTO `obavestenje` VALUES (2, 'Poštovani studenti,\n\nBiranje predmeta i upis u školsku 2023/24. godinu može se izvršiti od četvrtka 7. septembra za studente u Beogradu kao i centrima Novi Sad i Niš. Procedura upisa sastoji se od:\n\nPopunjavanja ŠV-20 obrasca\nBiranja predmeta na Estudent nalogu (studenti koji su prešli sa drugih visokoškolskih ustanova predmete ne biraju preko Estudent naloga već se za iste opredeljuju na upisu)\nPotpisivanja ugovora\nMolimo Vas da se upoznate sa kompletnom procedurom upisa koju možete pročitati na sledećem linku* kako biste izbegli eventualne nesporazume.\n\nPredaja indeksa i uplatnica za upis godine vrši se:\n\n• U Beogradu: radnim danima od 10:00 do 18:00 i subotom od 09:00 do 14:00 na šalterima za upis - II sprat, zgrada u Danijelovoj 32\n\n• U Novom Sadu: radnim danima od 09:00 do 17:00 i subotom od 09:00 do 14:00 u studentskoj službi\n\n• u Nišu: radnim danima od 09:00 do 17:00 i subotom od 09:00 do 14:00 u studentskoj službi', '2023-08-08', '2024-01-31', 'Upis u naredne godine studija');
